-- SQLCC CRUD性能基准测试脚本 - 包含10,000行实际测试数据
-- 此脚本用于验证CRUD操作是否满足'1-10万行数据，单操作耗时<5ms (SSD)'的性能要求

-- 1. 创建和使用测试数据库
CREATE DATABASE crud_benchmark_db;
USE crud_benchmark_db;

-- 2. 创建测试表
CREATE TABLE performance_test (
    id INT PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(100) NOT NULL,
    email VARCHAR(100) NOT NULL,
    age INT NOT NULL,
    salary DECIMAL(10,2) NOT NULL,
    department VARCHAR(50) NOT NULL,
    hire_date DATETIME NOT NULL,
    last_update TIMESTAMP NOT NULL
);

-- 3. 插入测试数据 - 10,000行
-- 测试点：插入性能

-- 4. SELECT操作性能测试

-- 4.1 点查询测试（按主键查询单条记录）
-- 测试点：单条记录查询性能，要求<5ms
SELECT * FROM performance_test WHERE id = 5000;
SELECT * FROM performance_test WHERE id = 100;
SELECT * FROM performance_test WHERE id = 9999;

-- 4.2 范围扫描测试（查询多条记录）
-- 测试点：范围查询性能，要求<5ms
SELECT * FROM performance_test WHERE age BETWEEN 30 AND 40;
SELECT * FROM performance_test WHERE department = 'Engineering';
SELECT * FROM performance_test WHERE salary > 100000;

-- 4.3 排序查询测试
-- 测试点：带排序的查询性能
SELECT * FROM performance_test ORDER BY salary DESC LIMIT 10;
SELECT * FROM performance_test ORDER BY hire_date ASC LIMIT 5;

-- 5. UPDATE操作性能测试

-- 5.1 单点更新测试
-- 测试点：单条记录更新性能，要求<5ms
UPDATE performance_test SET salary = salary * 1.05 WHERE id = 5000;
UPDATE performance_test SET department = 'Management' WHERE id = 100;

-- 5.2 范围更新测试
-- 测试点：多条记录更新性能
UPDATE performance_test SET department = 'R&D' WHERE department = 'Engineering';
UPDATE performance_test SET salary = salary + 1000 WHERE age > 50;

-- 6. DELETE操作性能测试

-- 6.1 单点删除测试
-- 测试点：单条记录删除性能，要求<5ms
DELETE FROM performance_test WHERE id = 9999;
DELETE FROM performance_test WHERE id = 500;

-- 6.2 范围删除测试
-- 测试点：多条记录删除性能
DELETE FROM performance_test WHERE age > 60;
DELETE FROM performance_test WHERE salary < 40000;

-- 7. 清理测试数据
DROP TABLE performance_test;
DROP DATABASE crud_benchmark_db;

-- 性能测试脚本结束
